#include <stdio.h>

int main(void)
{
  int A=0, G=0, C=0, T=0;
  int Flag=0, count=0;
  char AGCTTA[]="AGCTTA";
  char GTACA[]="GTACA";
  int i,j;
  char Ebola[] = "";

  for(i=0; Ebola[i]!='\0'; i++){
    switch(Ebola[i]){
    case 'A':
      A++;
      break;

    case 'G':
      G++;
      break;

    case 'C':
      C++;
      break;

    case 'T':
      T++;
      break;
    }
  }
  printf("(1)\n A : G : C : T =  %d%% : %d%% : %d%% : %d%%\n", A*100/i, G*100/i, C*100/i, T*100/i);
  
  for(i=0; Ebola[i]!='\0'; i++){
    Flag= 0;
    for(j=0; AGCTTA[j]!='\0'; j++){
      if(Ebola[i+j]==AGCTTA[j]){
	Flag++;
      }
    }
    if(Flag==6){
      count++;
    }
  }
  printf("(2)\n AGCTTA= %d\n", count);


  printf("(3)\n ");
  for(i=0; Ebola[i]!='\0'; i++){
    Flag= 0;
    for(j=0; GTACA[j]!='\0'; j++){
      if(Ebola[i+j]==GTACA[j]){
	Flag++;
      }
    }
    if(Flag==6){
      printf("AAA");
      i+= 5;
    }
    printf("%c", Ebola[i]);
  }
  printf("\n");
  
  return 0;
}
